import React from 'react';
import { Route, Switch } from 'react-router-dom';
import './App.css';
import HomePage from './pages/homepage/HomePage.component';

function App() {
	return (
		<Switch>
			<Route exact path="/" render={(routerProps) => <HomePage />} />
		</Switch>
	);
}

export default App;
